  `City` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市全称',
  `District` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '区县全称',
  `ProvinceShortName` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省份简称',
  `CityShortName` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市简称',
  `DistrictShortName` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '区县简称',
  `ProvincePinyin` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省份拼音',
  `CityPinyin` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市拼音',
  `DistrictPinyin` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '区县拼音',
  `Pinyin` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '拼音',
  `Jianpin` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '简拼',
  `FirstChar` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '首拼',
  `CityCode` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '区号',
  `ZipCode` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '邮编',
  `lng` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '经度',
  `Lat` varchar(45) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '维度',
